import React from "react";
import data from "../../data.json";

class Admin extends React.Component {
  render() {
    return (
      <div>
        {data.map((e) => {
          return (
            <div>
              <h1 key={e.id}>{e.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Admin;
